  const [isLoading, setIsloading] = useState(false)

  useEffect(() => {
    const getInitialData = async() => {
      try {
        const res = await axios({method:'GET', url:'https://simple-blog-api.crew.red/posts'})
        setData(res.data)
        console.log(res.data)
      } catch(e) {
        console.log(e)
      }
    }
    getInitialData()
  },[])
  return (<div>
    {data !== null && <Container {...data}/>}
  </div>);
}

export default HomePage;
